import React from 'react';
import styled from 'styled-components';
import Icon from './Icon';
const Container = styled.div`
      height: 100px;
      width:350px;
      background-color:aliceblue;
      display:flex;
      flex-direction:row;
`


const App =() => {
  return (
    <Container>
      <Icon>
        <p>Hola</p>
      </Icon>
      <ColBody>
        <p>zzzz xxxx mmmmm</p>
      </ColBody>
    </Container>
  );
}

export default App;
